import React from 'react';

import './CustomButton.styles.scss';

const CustomButton = ({
	children,
	...otherProps
}) => {
	return (
		<CustomButton
			className='custom-button' {...otherProps}
		>
			{children}
		</CustomButton>
	);
};

export default CustomButton;
